  `userName` varchar(100) DEFAULT NULL COMMENT 'åˆ›å»ºäººåç§°',
  `flowid` varchar(100) DEFAULT NULL COMMENT 'ç»‘å®šæµç¨‹id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

